import React, { useEffect, useState } from "react";
import "./News.css";
// https://newsapi.org/v2/everything?q=pollutions&apikey=226cb84b76db43dcb0b55516711accb2

function News() {
  const url =
    "https://newsapi.org/v2/everything?q=pollutions&apikey=226cb84b76db43dcb0b55516711accb2";

  const [articles, setArticles] = useState([]);

  const news = async () => {
    try {
      const response = await fetch(url);
      const data = await response.json();
      setArticles(data);
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    news();
  }, []);
  console.log(articles.url);

  return (
    <>
      {Aarticles.map((element) => {
        return (
          <div className="col-md-4" key={articles[element]}>
            <h3>{articles.title? articles.title : "not found"}</h3>
          </div>
        );
      })}
    </>
  );
}

export default News;
